import PropTypes from "prop-types";
import Link from "next/link";
import { Menu } from "antd";
import {
  AppstoreOutlined,
  MailOutlined,
  SettingOutlined,
} from "@ant-design/icons";
const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>노드버드</a>
        </Link>
        <Link href="/profile">
          <a>프로필</a>
        </Link>
        <Link href="/signup">
          <a>회원가입</a>
        </Link>
        {children}
      </div>
    </div>
  );
};
AppLayout.prototype = {
  children: PropTypes.node.isRequired,
};
export default AppLayout;
